import {ReactComponent as GithubIcon} from './assets/img/github.svg';

function App() {
  return (
    <header>
      <nav>
        <div>
          <h1>DSMovie</h1>
          <a href="http://github.com/serginhobalski/dsmovie" target="_blank" rel="noopener noreferrer"></a>
          <div>
            <GithubIcon />
          </div>
        </div>
      </nav>
    </header>
  );
}

export default App;
